import React, { useState } from 'react';
import './Pokedex.scss';

const Screen = props => {
    const data = props.data

    const getAttribute = (key, name) => {
        if (!data[key])
        return null

        return (

            <div className="pokedex__screen-row">
                <spam className="pokedex__screen-key">{name}</spam>
                <spam className="pokedex__screen-value">{data[key]}</spam>


            </div>
        )
    }

    return (
        <div>
            {getAttribute("id", "Id")}
            {getAttribute("weight", "Id")}
            {getAttribute("height", "Id")}
        </div>
    )

}


const Pokedex = props => {
    const data = props.data || {}


    console.log(props.data)


    const pokemonImage = data.sprites && data.sprites.front_default ?
        <img src={data.sprites.front_defaul} alt="pokemon" /> :
        <div className="pokedex__image" />

    const [searchResponse, setSearchResponse] = useState()


    return (
        <div className="pokedex">
            <div className="pokedex__container">
                <div className="pokedex__top">
                    <spam className="pokedex__camera" />
                </div>

                <div className=" pokedex__top pokedex__top--right">
                    <spam className="pokedex__dot pokedex__dot--red" />
                    <spam className="pokedex__dot pokedex__dot--yellow" />
                    <spam className="pokedex__dot pokedex__dot--green" />
                </div>
                <div className="pokedex__image-container">
                    {pokemonImage}

                </div>
            </div>
            <div className="pokedex__container pokedex__container--right" >
                <div className="pokedex__screen">
                    <div className="pokedex__screen-row">
                        <h4 className="pokedex__screen-title">
                            {
                                data.success && data.name ?
                                    data.name :
                                    null
                            }
                        </h4>
                    </div>
                    <Screen data={data} />
                </div>

            </div>
        </div>
    );
}

export default Pokedex;
